import React from "react";
import "../Profile.css";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Title1, Title3 } from '@fluentui/react-components';


export interface Education {
  school: string;
  degree: string;
  graduationYear: number;
}

export interface Experience {
  company: string;
  position: string;
  startDate: string;
  endDate: string;
  description: string;
}

interface ProfileProps {
  name: string;
  title: string;
  email: string;
  phone: string;
  linkedIn: string;
  summary: string;
  education: Education[];
  experience: Experience[];
}

const Profile: React.FC<ProfileProps> = ({
  name,
  title,
  email,
  phone,
  linkedIn,
  summary,
  education,
  experience,
}) => {
  return (
    <div className="resume">
      <Container>
        <Row>
          <Title1>{name}</Title1>
          <Title3>{title}</Title3>
        </Row>
        <Row>
          <Col>Email: {email}</Col>
          <Col>Phone: {phone}</Col>
          <Col>LinkedIn: {linkedIn}</Col>
        </Row>
        <Row><Col> </Col></Row>
        <Row>
          <Col>
            <h4>Summary</h4>
          </Col>
          </Row>
          <Row>
          <Col>
            {summary}
            </Col>
        </Row>




      </Container>











      <div className="summary">
        <h3>Summary</h3>
        <p>{summary}</p>
      </div>
      <div className="education">
        <h3>Education</h3>
        {education.map((edu, index) => (
          <div key={index}>
            <h4>{edu.school}</h4>
            <p>{edu.degree}</p>
            <p>Graduation Year: {edu.graduationYear}</p>
          </div>
        ))}
      </div>
      <div className="experience">
        <h3>Experience</h3>
        {experience.map((exp, index) => (
          <div key={index}>
            <h4>{exp.position}</h4>
            <p>{exp.company}</p>
            <p>
              {exp.startDate} - {exp.endDate}
            </p>
            <p>{exp.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Profile;
